[memory-addresses]
regex: <[\w._ ]* at 0x\w*>
replace: <Object in memory>

[figures]
regex: <.*[fF]igure.*>
replace: <Figures>

[datestamp]
regex: \d{1,2}/\d{1,2}/\d{2,4}
replace: DATE-STAMP

[timestamps]
regex: \d{2}:\d{2}:\d{2}(,\w+)?
replace: TIME-STAMP

[filepaths]
regex: /.*/lightlab/.*
replace: SYSTEM-PATH

[autoreload]
regex: .*autoreload.*
replace:
